The Client struct is the main entry point for the driver. You can create one from a ClientOptions struct: # extern crate mongodb;
# use mongodb::{Client, options::ClientOptions};
# async fn run() -> mongodb::error::Result<()> {
# let options = ClientOptions::parse("mongodb://mongodb0.example.com:27017").await?;
let client = Client::with_options(options)?;
# Ok(())
# } As a convenience, if you don't need to modify the ClientOptions before creating the Client, you can directly create one from the connection string: # extern crate mongodb;
# use mongodb::Client;
# async fn run() -> mongodb::error::Result<()> {
let client = Client::with_uri_str("mongodb://mongodb0.example.com:27017").await?;
# Ok(())
# } Client uses std::sync::Arc internally, so it can safely be shared across threads or async tasks. For example: # extern crate mongodb;
# extern crate tokio;
# use mongodb::{bson::Document, Client, error::Result};
# use tokio::task;
#
# async fn start_workers() -> Result<()> {
let client = Client::with_uri_str("mongodb://example.com").await?; for i in 0..5 { let client_ref = client.clone(); task::spawn(async move { let collection = client_ref.database("items").collection::<Document>(&format!("coll{}", i)); // Do something with the collection });
}
#
# Ok(())
