Once you have a Client, you can call Client::database to create a handle to a particular database on the server, and Database::collection to create a handle to a particular collection in that database. Database and Collection handles are lightweight - creating them requires no IO, cloneing them is cheap, and they can be safely shared across threads or async tasks. For example: # extern crate mongodb;
# extern crate tokio;
# use mongodb::{bson::Document, Client, error::Result};
# use tokio::task;
#
# async fn start_workers() -> Result<()> {
# let client = Client::with_uri_str("mongodb://example.com").await?;
let db = client.database("items"); for i in 0..5 { let db_ref = db.clone(); task::spawn(async move { let collection = db_ref.collection::<Document>(&format!("coll{}", i)); // Do something with the collection });
}
#
# Ok(())
# } A Collection can be parameterized with a type for the documents in the collection; this includes but is not limited to just Document. The various methods that accept instances of the documents (e.g. Collection::insert_one ) require that it implement the Serialize trait from the serde crate. Similarly, the methods that return instances (e.g. Collection::find_one ) require that it implement Deserialize. Document implements both and can always be used as the type parameter. However, it is recommended to define types that model your data which you can parameterize your Collections with instead, since doing so eliminates a lot of boilerplate deserialization code and is often more performant. # extern crate mongodb;
# extern crate tokio;
# extern crate serde;
# use mongodb::{
# bson::doc,
# error::Result,
# };
# use tokio::task;
#
# async fn start_workers() -> Result<()> {
# use mongodb::Client;
#
# let client = Client::with_uri_str("mongodb://example.com").await?;
use serde::{Deserialize, Serialize}; // Define a type that models our data.
#[derive(Clone, Debug, Deserialize, Serialize)]
struct Item { id: u32,
} // Parameterize our collection with the model.
let coll = client.database("items").collection::<Item>("in_stock"); for i in 0..5 { // Perform operations that work with directly our model. coll.insert_one(Item { id: i }, None).await;
}
#
# Ok(())
# } For more information, see the Serde Integration section.

