Results from queries are generally returned via Cursor , a struct which streams the results back from the server as requested. The Cursor type implements the Stream trait from the futures crate, and in order to access its streaming functionality you need to import at least one of the StreamExt or TryStreamExt traits. # In Cargo.toml, add the following dependency.
futures = "0.3" # extern crate mongodb;
# extern crate serde;
# extern crate futures;
# use serde::Deserialize;
# #[derive(Deserialize)]
# struct Book { title: String }
# async fn foo() -> mongodb::error::Result<()> {
# let typed_collection = mongodb::Client::with_uri_str("").await?.database("").collection::<Book>("");
// This trait is required to use `try_next()` on the cursor
use futures::stream::TryStreamExt;
use mongodb::{bson::doc, options::FindOptions}; // Query the books in the collection with a filter and an option.
let filter = doc! { "author": "George Orwell" };
let find_options = FindOptions::builder().sort(doc! { "title": 1 }).build();
let mut cursor = typed_collection.find(filter, find_options).await?; // Iterate over the results of the cursor.
while let Some(book) = cursor.try_next().await? { println!("title: {}", book.title);
}
# Ok(()) }

