A Client is implicitly bound to the instance of the tokio or async-std runtime in which it was created. Attempting to execute operations on a different runtime instance will cause incorrect behavior and unpredictable failures. This is easy to accidentally invoke when testing, as the tokio::test or async_std::test helper macros create a new runtime for each test. # extern crate mongodb;
# extern crate once_cell;
# extern crate tokio;
# use mongodb::Client;
# use std::error::Error;
use tokio::runtime::Runtime;
use once_cell::sync::Lazy; static CLIENT: Lazy<Client> = Lazy::new(|| { let rt = Runtime::new().unwrap(); rt.block_on(async { Client::with_uri_str("mongodb://example.com").await.unwrap() })
}); // This will inconsistently fail.
#[tokio::test]
async fn test_list_dbs() -> Result<(), Box<dyn Error>> { CLIENT.list_database_names(None, None).await?; Ok(())
} To work around this issue, either create a new Client for every async test, or bundle the Runtime along with the client and don't use the test helper macros. # extern crate mongodb;
# extern crate once_cell;
# extern crate tokio;
# use mongodb::Client;
# use std::error::Error;
use tokio::runtime::Runtime;
use once_cell::sync::Lazy; static CLIENT_RUNTIME: Lazy<(Client, Runtime)> = Lazy::new(|| { let rt = Runtime::new().unwrap(); let client = rt.block_on(async { Client::with_uri_str("mongodb://example.com").await.unwrap() }); (client, rt)
}); #[test]
fn test_list_dbs() -> Result<(), Box<dyn Error>> { let (client, rt) = &*CLIENT_RUNTIME; rt.block_on(async { client.list_database_names(None, None).await })?; Ok(())
} or # extern crate mongodb;
# extern crate tokio;
# use mongodb::Client;
# use std::error::Error;
#[tokio::test]
async fn test_list_dbs() -> Result<(), Box<dyn Error>> { let client = Client::with_uri_str("mongodb://example.com").await?; CLIENT.list_database_names(None, None).await?; Ok(())
}

