Connecting to a MongoDB database requires using a connection string , a URI of the form: mongodb://[username:password@]host1[:port1][,...hostN[:portN]][/[defaultauthdb][?options]] At its simplest this can just specify the host and port, e.g. mongodb://mongodb0.example.com:27017 For the full range of options supported by the Rust driver, see the documentation for the ClientOptions::parse method. That method will return a ClientOptions struct, allowing for directly querying or setting any of the options supported by the Rust driver: # extern crate mongodb;
# use mongodb::options::ClientOptions;
# async fn run() -> mongodb::error::Result<()> {
let mut options = ClientOptions::parse("mongodb://mongodb0.example.com:27017").await?;
options.app_name = Some("My App".to_string());
# Ok(())
# }
